<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Array concat</title>
</head>
<body>

    <script>
        console.log(['10','10','10','10','10'].map(parseInt));
        ['10','10','10','10','10', '10','10','10'].map(function(num) {
            console.log(parseInt(num))
        })
    </script>
    
</body>
</html>
